import {Link} from 'react-router-dom'
const ButtonPrimary = () => {
    return (
        <Link to='/'>
            <button className='px-8 py-4 bg-[rgb(0,)]'>
                Let's work                
            </button>
        </Link>
    )
}
export default ButtonPrimary;
